import { 
        BarChart, 
        Bar, 
        XAxis, 
        YAxis, 
        ResponsiveContainer, 
    } from 'recharts';

export default function OrderBookChart () {

    const fakeData = [
                        {asking_price: 100, shares: 50},
                        {asking_price: 200, shares: 5} 
                    ]; 

    return (
        <div> 
            <p>order book chart </p>
            {/* <BarChart width={600} height={400} data={fakeData}> */}
            <ResponsiveContainer>
                <BarChart 
                    width={600} height={400} data={fakeData} 
                    margin={{ top: 20, right: 30, left: 20, bottom: 5 }}
                >
                    <XAxis datakey="asking_price"/>
                    <YAxis />
                    <Bar 
                        datakey="shares" 
                        barSize={300} 
                        fill="#8884d8"
                    />
                </BarChart>
            </ResponsiveContainer>
        </div>
    )
}
